/*
 *
 * GenStanfordBunnySolidList()
 * 
 *  creates a display list of
 *  triangles (solid geometry) from bunny 
 *  data above and returns
 *  the display list id
 */

void setupBunny(GFXVertexPCN* v)
{
   U32 i;
   S32 j;
   U32 vert = 0;

   for(i=0;i<(sizeof(face_indicies)/sizeof(face_indicies[0]));i++)
   {
      for(j=0;j<3;j++)
      {
         int vi=face_indicies[i][j];
         int ni=face_indicies[i][j+3];//Normal index
         Point3F point = Point3F(vertices[vi][0], vertices[vi][1], vertices[vi][2]);
         v[vert].normal = Point3F(normals[ni][0], normals[ni][1], normals[ni][2]);
         v[vert].point = point;
         v[vert].color.set(
            U8((point.x * 100.f) + 127.f),
            U8((point.y * 100.f) + 127.f),
            U8((point.z * 100.f) + 127.f));
         vert++;
      }
   }
}


